<h1 class="entry-title">RAPAT PEMBENTUKAN PENGURUS INTI DEWAN EKSEKUTIF MAHASISWA (DEMA) MASA JABATAN TAHUN 2024 – 2025</h1>
<div class="entry-divider is-divider small"></div>

	<div class="entry-meta uppercase is-xsmall">
		<span class="posted-on">Posted on <a href="https://staimsyk.ac.id/rapat-pembentukan-pengurus-inti-dewan-eksekutif-mahasiswa-dema-masa-jabatan-tahun-2024-2025/" rel="bookmark"><time class="entry-date published" datetime="2024-11-05T14:48:06+07:00">November 5, 2024</time><time class="updated" datetime="2024-11-05T19:41:28+07:00">November 5, 2024</time></a></span><span class="byline"> by <span class="meta-author vcard"><a class="url fn n" href="https://staimsyk.ac.id/author/ibnu/">Admin</a></span></span>	</div><!-- .entry-meta -->
	</div><!-- .entry-header -->

