<p style="text-align: justify;"><a href="https://hypeskivelo.com/">pocari4d</a> Yogyakarta, Kamis 31 Oktober− Sekolah Tinggi Agama Islam Masjid Syuhada melaksanakan Rapat pembentukan pengurus inti Dewan Eksekutif Mahasiswa masa jabatan tahun 2024 &#8211; 2025. Rapat ini berlangsung di Ruang Munaqosyah Sekolah Tinggi Agama Islam Masjid Syuhada.</p>
<p style="text-align: justify;">Rapat pembentukan pengurus DEMA ini dihadiri oleh perwakilan mahasiswa setiap Angkatan : Angkatan 2021, 2022, 2023, dan 2024, wakil ketua Dema, Dosen dan pimpinan STAIMS (Ketua, Wakil Ketua I, Wakil Ketua II), Ketua Program Studi (Kaprodi), Kepala Bagian Umum. Dengan pembahasan Penjelasan terkait peran Dewan Eksekutif Mahasiswa, posisinya dan fungsinya dalam sebuah Sekolah Tinggi, Musyawarah tentang sistem pemilihan ketua Dema, Pengambilan suara terbanyak dalam pembentukan pengurus lnti DEMA. Bulan lalu sempat diadakan pemilihan dengan cara membuka pendaftaran kandidat calon ketua dan wakil ketua Dema, namun tidak ada yang mendaftar, Sehingga dengan keadaan tersebut pemilihan pengurus DEMA dilakukan secara aklamasi.</p>
<p style="text-align: justify;"><a href="https://hypeskivelo.com/">pocari4d</a> Kegiatan ini dibuka secara resmi oleh Bapak Permana Octofrezi S.Pd.I, M.Pd dalam sambutannya ia mengucapkan selamat kepada pengurus baru. “Saya berharap agar para pengurus mengemban amanah kepengurusan tahun ini dengan penuh tanggung jawab, melepas kepentingan individu, menentukan waktu pelantikan dan membuat proker ”, Ucapnya dalam pidato sambutan, Kamis siang (31/10).</p>
<p style="text-align: justify;">Selanjutnya, sebanyak 10 Peserta rapat telah menyetujui hasil rapat pembentukan pengurus inti Dewan Eksekutif Mahasiswa STAIMS masa jabatan 2024 – 2025 melalui voting (pemungutan suara), maka selanjutnya seluruh peserta memutuskan dan menyepakati beberapa hal yang berketetapan menjadi Keputusan akhir rapat ini,<br>yaitu:<br>1. Ketua : Muhammad Iqbal Maulana (Angkatan 2022)<br>2. Wakil Ketua : Devi Kumalasari (Angkatan 2023)<br>3. Sekretaris : Alif Bintang Pinesti (Angkatan 2024)</p>
<p style="text-align: justify;">Pelaksanaan kegiatan pelantikan ini menandai dimulainya masa kepengurusan baru yang diamanahkan kepada Muhammad Iqbal Maulana selaku Ketua Umum DEMA yang sebelumnya terpilih dan ditetapkan pada Musyawarah Rapat pembentukan pengurus inti DEMA Setelah terlaksananya kegiatan pelantikan ini, diharapkan kepada pengurus Dewan Eksekutif Mahasiswa STAIMS Periode 2024 &#8211; 2025 dapat menjalankan amanah yang telah diberikan dengan penuh tanggung jawab dan komitmen yang tinggi sehingga mampu memberikan kontribusi yang terbaik bagi Kampus.</p>
<p>&nbsp;</p>



